  `satuan` varchar(100) NOT NULL,
  `harga` int(100) NOT NULL,
  `total` int(100) NOT NULL,
  `gudang` varchar(100) DEFAULT NULL,
  `tanggal` date NOT NULL,
  `jam` time NOT NULL,
